  `SUBMIT_TIME` varchar(30) DEFAULT NULL COMMENT '递交时间_插入时即落地  YYYY-MM-DD HH24:MI:SS',
  `CREATE_TIME` varchar(30) DEFAULT NULL COMMENT '创建时间_yyyy-MM-dd HH24:MI:SS',
